import React from "react";
import ReactDOM from "react-dom";

function HomePage() {
    return <div>
        <nav class="navbar navbar-dark bg-primary py-5">
            <table>
                <tr>
                    <td>Home</td>
                    <td>Edit</td>
                    <td>Log Out</td>
                </tr>
            </table>
        </nav>
    </div>
}

export default HomePage;
